import React, { useState } from "react";
import "./Signup.css";
import { sendRequest } from "../../utils/sendRequest";

function Mignup() {
  
  const [suteItem, setSureItem] = useState();
  const [suteItem2, setSureItem2] = useState();
  const [suteItem3, setSureItem3] = useState();
  const [suteItem4, setSureItem4] = useState();


  const copyvalue = (e) => {
    setSureItem(e)
  };


  
  const copyvalue2 = (e) => {
    setSureItem2(1)
  };


  
  const copyvalue3 = (e) => {
    setSureItem3(e)
  };


  
  const copyvalue4 = (e) => {
    setSureItem4(e)
  };

  const monister = ()=>{


  }


  return (
    <div>
      <div className="loginPage">
        <div className="organize">
          <p className="loginString">sdasda in</p>
        </div>
        <div className="inputLogin">
          <input
            type="email"
            className="firstInput"
            placeholder="firstName"
            onChange={(e) => copyvalue(e.target.value, "", "", "")}
          />
          <input
            type="password"
            className="secondInput"
            placeholder="secondeName"
            onChange={(e) => copyvalue2(e.target.value)}
          />
          <input
            type="password"
            className="secondInput"
            placeholder="email"
            onChange={(e) => copyvalue3(e.target.value)}
          />
          <input
            type="password"
            className="secondInput"
            placeholder="enterYourPassword"
            onChange={(e) =>copyvalue4(e.target.value)}
          />
        </div>

        <div className="enterToLogIin">
          <h1
            className="enterToLogIinString"
            onClick={() => {
              sendRequest(
                "signup",
                {
                  name: "amin",
                  secondName: "lahham",
                  email: "email@gmail.com",
                  password: "test",
                },
                "POST"
              );
            }}
          >
            sign in onClick={}
          </h1>
          <a className="signInString">log in </a>
        </div>
      </div>
    </div>
  );
}

export default Mignup;
